import React from "react";
import styles from "./Toolbar.module.css";
import Button from "../UI/Button/Button";
import Aux from "../../hocs/Aux/Aux";

const Toolbar = (props)=>{
  return(
    <div className = {styles.Toolbar}>
      <Button clicked = {() => props.changeFormTypeHandler("login")}classes = {["Auth"]}>Login</Button>
      <Button clicked = {() => props.changeFormHandler("signup")}classes = {["Auth"]}>Signup</Button>
    </div>
  )
}
export default Toolbar;
